import React, { Component } from 'react'
import '../../index.css'
import { MDBContainer } from "mdbreact";
import CityCard from '../functional/CityCard'
import SearchBar from '../functional/SearchBar';

class CitiesPage extends Component {
    componentDidMount(){
        this.setState({
            cities: data
        })
    }
    render() {
        return (
            <MDBContainer className="content-container">
                <SearchBar />
                <CityCard />
            </MDBContainer>
        )
    }
}

export default CitiesPage;
